      <Router>
        <Switch>
          <Route path="" exact component={DashboardMain} />
          <Route exact path="/login" component={Login} />
          <Route exact path="/register" component={Register} />
          <Route exact path="/123" exact render={() => {
            return(<h3>123123</h3>)
          }} />
        </Switch>
      </Router>
    )
  }
}

export default Main;
